package main

import (
	"github.com/dfengwji/pss.common/writing"
	"github.com/fogleman/gg"
)

func main()  {
	testGraph3()
}

func parseHexDots(num uint16, hex string) []*writing.DotInfo {
	c := int(num * writing.DotHexLength)
	if len(hex) != c {
		return nil
	}
	dots := make([]*writing.DotInfo, 0, num)
	var i uint16 = 0
	for i = 0; i < num; i += 1 {
		var dot = new(writing.DotInfo)
		err := dot.ParseHex(hex[i*writing.DotHexLength : (i+1)*writing.DotHexLength])
		if err != nil {
		} else {
			dots = append(dots, dot)
			//fmt.Println(dot.String())
		}
	}
	return dots
}

func testGraph3()  {
	hex1 := ""
	hex2 := ""
	dots1 := parseHexDots(uint16(len(hex1)/writing.DotHexLength), hex1)
	dots2 := parseHexDots(uint16(len(hex2)/writing.DotHexLength), hex2)
	path := "files/images/test2.jpg"
	//writing.DrawImage(dots, writing.Vector2{X:1080, Y:1920}, writing.Vector2{X:176, Y:250},path)
	bg,_ := writing.DrawDots(dots2, writing.Vector2{X:1080, Y:1920}, writing.Vector2{X:176, Y:250}, 1)
	canvas,_ := writing.DrawDotsWithBG(dots1, writing.Vector2{X:1080, Y:1920}, writing.Vector2{X:176, Y:250}, bg.Image())
	gg.SaveJPG(path, canvas.Image(), 100)
}